import React from 'react';
// import logo from './logo.svg';
import './MainContainer.css';

function Clock(props) {
  return (
    <div>
      <h1>Hello, World</h1>
      <h2>It is {props.date.toLocaleTimeString()}</h2>
    </div>
  )
}

function render() {
  return <Clock date={new Date()} />
}

export default render
